import React from 'react';
import { Waves } from './footer.styles';

const Footer = () => {
	return (
		<div>
			<Waves />
			<div
				style={{
					position: 'relative',
					color: 'white',
					display: 'flex',
					justifyContent: 'center',
					backgroundColor: 'grey',
				}}
			>
				Whats up
			</div>
		</div>
	);
};

export default Footer;
